css:
@-moz-document domain("duckduckgo.com") {
.header__logo, .logo_homepage {
 background-image: url(https://proxy.duckduckgo.com/iu/?u=https%3A%2F%2Fsagarhani.files.wordpress.com%2F2015%2F07%2Fduck_duck_go.png&f=1) !important;
    background-size: auto 100%;
}

.header__logo, .header__praise, .header__avatar {
    width: 80px;
    height: 80px;
}

.header__logo, .header__praise, .header__avatar {
    margin-right: 43px;
    margin-top: 25px;
}

.tag-home {
 display: none;
}

div.header--aside__item:nth-child(2) {
 display: none;
}

div.header--aside__item:nth-child(3) {
 display: none;
}
}
